import React, { useState } from 'react';

const Navigation = () => {
  const [currentTab, setCurrentTab] = useState('home');

  const handleTabChange = (e, tab) => {
    e.preventDefault();
    setCurrentTab(tab);
  }

  return (
    <nav>
      <ul>
        <li className={currentTab === 'home' ? 'active' : ''}>
          <a href="#" onClick={e => handleTabChange(e, 'home')}>Home</a>
        </li>
        <li className={currentTab === 'about' ? 'active' : ''}>
          <a href="#" onClick={e => handleTabChange(e, 'about')}>About</a>
        </li>
        <li className={currentTab === 'services' ? 'active' : ''}>
          <a href="#" onClick={e => handleTabChange(e, 'services')}>Services</a>
        </li>
        <li className={currentTab === 'contact' ? 'active' : ''}>
          <a href="#" onClick={e => handleTabChange(e, 'contact')}>Contact</a>
        </li>
        <li className={currentTab === 'help' ? 'active' : ''}>
          <a href="#" onClick={e => handleTabChange(e, 'help')}>Help</a>
        </li>
      </ul>
    </nav>
  );
}

export default Navigation;
